//react libraries
import React, { Component } from "react";
import ReactDOM from 'react-dom';
import '../../index.scss';

//bootstrap
import 'bootstrap/dist/css/bootstrap.min.css';

//font awesome
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

class Dare extends Component{
  constructor(props){
    super(props);
    this.state = {
      failed: false
    };
  }

  render(){
    return(
      <button onClick={() => this.setState({failed: !this.state.failed})}>
        <div class="container" id="dareContainer">
          <div class="row">
            <div class="col">
            <FontAwesomeIcon icon="dice-one" />
              {this.state.failed ? 
                <strike>{this.props.text}</strike> :
                <p>{this.props.text}</p>
              }
            </div>
          </div>
        </div>
      </button>
      
    );
  }
}

export default Dare;
